    private void jToggleButton2ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jToggleButton2ActionPerformed
        // TODO add your handling code here:
        //alpha & ei
        for (int i = 0; i < normallatih.getModel().getRowCount(); i++) {
            Tei.getModel().setValueAt(data.getModel().getValueAt(i, 0), i, 0);
            Tei.getModel().setValueAt(ei_alpha[i][0], i, 1);
            Tei.getModel().setValueAt(ei_alpha[i][1], i, 2);
        }
        //x -& x+
        System.out.println(kelas[xminxpos[0]]);
        Object xmin = data.getModel().getValueAt(xminxpos[0], 0);
        Object xpos = data.getModel().getValueAt(xminxpos[1], 0);
        Txminxpos.getModel().setValueAt("ID", 0, 0);
        Txminxpos.getModel().setValueAt(xmin, 0, 1);
        Txminxpos.getModel().setValueAt(xpos, 0, 2);
        //wx- wx+
        for (int i = 0; i < Twx.getModel().getRowCount() - 1; i++) {
            Twx.getModel().setValueAt(data.getModel().getValueAt(i, 0), i, 0);
            Twx.getModel().setValueAt(wxminwxpos[i][0], i, 2);
            Twx.getModel().setValueAt(wxminwxpos[i][1], i, 1);

        }
        Twx.getModel().setValueAt("Jumlah", Twx.getModel().getRowCount() - 1, 0);
        Twx.getModel().setValueAt(wxminwxpos[Twx.getModel().getRowCount() - 1][1], Twx.getModel().getRowCount() - 1, 1);
        Twx.getModel().setValueAt(wxminwxpos[Twx.getModel().getRowCount() - 1][0], Twx.getModel().getRowCount() - 1, 2);
        //bias
        nilaibias.setText(String.valueOf(Nbias));
        //hasil
        for (int i = 0; i < datauji.getModel().getRowCount(); i++) {
            Tfx.getModel().setValueAt(datauji.getModel().getValueAt(i, 0), i, 0);
            Tfx.getModel().setValueAt(datauji.getModel().getValueAt(i, 4), i, 1);
            Tfx.getModel().setValueAt(hasil[i], i, 2);
        }
        
    }//GEN-LAST:event_jToggleButton2ActionPerformed

