    private void jToggleButton1ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jToggleButton1ActionPerformed
        // TODO add your handling code here:
        //kernel
        for (int i = 0; i < normallatih.getModel().getRowCount(); i++) {
            kernel1.getModel().setValueAt(data.getModel().getValueAt(i, 0), i, 0);
        }
        for (int i = 0; i < normallatih.getModel().getRowCount(); i++) {
            for (int j = 0; j < normallatih.getModel().getRowCount(); j++) {
                kernel1.getModel().setValueAt(kernel_latih[i][j], i, j + 1);
            }
        }
        //hessian
        for (int i = 0; i < normallatih.getModel().getRowCount(); i++) {
            Thesian.getModel().setValueAt(data.getModel().getValueAt(i, 0), i, 0);
        }
        for (int i = 0; i < normallatih.getModel().getRowCount(); i++) {
            for (int j = 0; j < normallatih.getModel().getRowCount(); j++) {
                Thesian.getModel().setValueAt(hessian[i][j], i, j + 1);
            }
        }
    }//GEN-LAST:event_jToggleButton1ActionPerformed

